style.css:
@-moz-document domain("reddit.com") {
html, body, *{
font-family: monospace !important;
}

header{
background-color:#E8F2FE; opacity: 0.0; }

header:hover{
opacity: 1.0; }

.tagline{ color: #fff !important; } .author{ color: #00f !important; } .author:before{ content:"public function " !important; } .author:after{ content: " (instance: Object):void {"; } .buttons:before{ content: "} "; } .arrow, .side, .expand,ul.buttons li{ opacity: 0.0; } .arrow:hover, .side:hover, .expand:hover, ul.buttons li:hover{ opacity: 1.0; } .entry, .tagline{ font-size: 12px !important; } .usertext { margin-left: 30px !important; }
}
